const bubblesort = (list) => {
	const length = list.length;
	for(var i = length - 1; i>=0; i--){
		for(var j = 1; j<length; j++){
			if(list[j-1] > list[j]){
				let temp = list[j-1];
				list[j-1] = list[j];
				list[j] = temp;
			}
		}
	}
	return list
}
